import React from "react";
import Link from "next/link";


const Pesquisa = () => {

    return (
        <div>
            <h1>Pesquisa</h1>
            <div>
                <Link href= "/home">
                    <a>Home</a>
                </Link>
            </div>
        </div>
    );
};

export default Pesquisa;
